import React, { useEffect, useState } from 'react';


function App(){

  const [num , setnum] = useState(0)

  useEffect(function (){
    alert("I am Clicked");
  })

  function increment(){
    setnum(num + 1);

 
  }


  return(
    <button onClick={increment}>Click me {num}</button>
  )
}

export default App;
